<h2>CSV</h2>
<p>CSV data are rendered as tables</p>
<pre>
<code>
    ```csv
    foo,bar,baz
    apple,banana,carrots
    rust,haskel,c
    ```
</code>
</pre>
<table><thead><tr><th>foo</th><th>bar</th><th>baz</th></tr></thead></thead><tbody><tr><td>apple</td><td>banana</td><td>carrots</td></tr><tr><td>rust</td><td>haskel</td><td>c</td></tr></tbody></table>
<p>Codes syntax highlighted.</p>
<pre><code class="language-sql">
select * from data limit 1

</code></pre>
<pre><code class="language-rust">fn main(){
	println!(&quot;hello world!&quot;);
}
</code></pre>
<h2>Math equations</h2>
<p>\[ E = m * c ^ 2 \]</p>
<p>\[ \frac{1}{\Bigl(\sqrt{\phi \sqrt{5}}-\phi\Bigr) e^{\frac25 \pi}} = 1+\frac{e^{-2\pi}} {1+\frac{e^{-4\pi}} {1+\frac{e^{-6\pi}} {1+\frac{e^{-8\pi}} {1+\cdots} } } } \]</p>
<p>\[ \left( \sum_{k=1}^n a_k b_k \right)^2 \leq \left( \sum_{k=1}^n a_k^2 \right) \left( \sum_{k=1}^n b_k^2 \right) \]</p>
